import React from "react";

import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";

const showIncome = () => {
  console.log("Mostrar ingresos");
};

export default function Navigationbar() {
  return (
    <Navbar bg="dark" variant="dark" expand="lg">
      <Navbar.Brand>Personal Budget</Navbar.Brand>

      <Navbar.Toggle aria-controls="basic-navbar-nav" />

      <Navbar.Collapse id="basic-navbar-nav">
        {
          //NAVBAR
        }
        <Nav className="mr-auto">
          <Nav.Link>Home</Nav.Link>

          <Nav.Link onClick={showIncome}>Income</Nav.Link>

          <Nav.Link>Expenses</Nav.Link>

          <Nav.Link>Categories</Nav.Link>
        </Nav>
        <Nav className="ml-auto">
          <NavDropdown title="User" alignRight>
            <NavDropdown.Item>My profile</NavDropdown.Item>

            <NavDropdown.Divider />

            <NavDropdown.Item>Close session</NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}
